import React from 'react';
import './NavBar.css';

function NavBar() {
  return (
    <nav className="nav">
      <img src="https://www.svgrepo.com/show/481658/fish-2.svg" alt="fish logo" />
      <a
        href="/"
        className="title"
      >
        manjuba
      </a>
      <ul>
        <li>
          <a href="#about">sobre</a>
        </li>
        <li className="active">
          <a href="#contact">contato</a>
        </li>
      </ul>
    </nav>
  );
}

export default NavBar;
